];

const categories = [
  "Agriculture, Environment and Rural Affairs",
  "Communities",
  "Economy",
  "Education",
  "Finance and Personnel",
  "Health, Social Services and Public Safety",
  "Infrastructure",
  "Justice",
  "Office of the First Minister and Deputy First Minister",
  "Other",
];

const drilldownData = {
  "2010": {
