  "2025": {
    categories,
    resource: [630, 950, 850, 2700, 185, 7200, 470, 1160, 105, 88],
    capital: [170, 220, 85, 220, 35, 330, 600, 125, 42, 25],
  },
};

const BarChartComponent = () => {
  const [year, setYear] = useState("2025");
  const [chartOptions, setChartOptions] = useState({
    chart: { type: "column" },
    title: { text: "Budget Data" },
    xAxis: {
      categories: mainData.map((item) => item.Year),
      crosshair: true,
    },
    yAxis: {
      min: 0,
      title: {
        text: "Budget (Million £)",
      },
    },
    tooltip: {
      shared: true,
      useHTML: true,
      headerFormat: '<b>{point.key}</b><br>',
      pointFormat:
        '{series.name}: {point.y:.1f} M£<br>',
    },
    plotOptions: {
      column: {
        pointPadding: 0.2,
        borderWidth: 0,
      },
    },
    series: [
      {
        name: "Total Budget",
        data: mainData.map((item) => item.TotalBudget),
        color: "#FF9933",
      },
      {
        name: "Total Resource",
        data: mainData.map((item) => item.TotalResource),
        color: "#FFCC33",
      },
      {
        name: "Total Capital",
        data: mainData.map((item) => item.TotalCapital),
        color: "#0066CC",
      },
    ],
  });

  const handleYearChange = (event) => {
    setYear(event.target.value);
  };

  const drilldownOptions = {
    chart: { type: "column" },
    title: { text: `Resource vs Capital Breakdown for ${year}` },
    xAxis: {
      categories: drilldownData[year].categories,
    },
    yAxis: {
      min: 0,
      title: { text: "Budget (Million £)" },
    },
    tooltip: {
      shared: true,
      useHTML: true,
      headerFormat: '<b>{point.key}</b><br>',
      pointFormat:
        '{series.name}: {point.y:.1f} M£<br>',
    },
    plotOptions: {
      column: {
        pointPadding: 0.2,
        borderWidth: 0,
      },
    },
    series: [
      {
        name: "Resource",
        data: drilldownData[year].resource,
        color: "#FFCC33",
      },
      {
        name: "Capital",
        data: drilldownData[year].capital,
        color: "#0066CC",
      },
    ],
  };

  return (
    <>
      <nav aria-label="breadcrumb">
        <ol className="breadcrumb">
          <li className="breadcrumb-item">
            <Link to="/">Home</Link>
          </li>
          <li className="breadcrumb-item active" aria-current="page">
            Budget
          </li>
        </ol>
      </nav>

      <h1>Budget Data Over Years</h1>

      <HighchartsReact highcharts={Highcharts} options={chartOptions} />

      <label htmlFor="year-select" style={{ marginTop: "20px" }}>
        Select Year for Drilldown:
      </label>
      <select
        id="year-select"
        value={year}
        onChange={handleYearChange}
        style={{ marginLeft: "10px" }}
      >
        {mainData.map((item) => (
          <option key={item.Year} value={item.Year}>
            {item.Year}
          </option>
        ))}
      </select>

      <HighchartsReact highcharts={Highcharts} options={drilldownOptions} />
    </>
  );
};

export default BarChartComponent;
